import React from 'react';
import './sidenav.css';
import dashboardicon from './cityscape.png';
import pipelineicon from './deal.png';
import reporticon from './tablet.png';

const SideNav = () => {
	return (
		<nav className="sidebar">
		  <a href="../App.js">
		    <div className="navicon top-pad">
			  <img src={ dashboardicon } alt="Dashboard" height="auto" width="40%" />Dashboard
		    </div>
		  </a>
		  <a href="../App.js">
		    <div className="navicon">
			<img src={ pipelineicon } height="auto" width="40%" alt="Pipeline" />Pipeline
		    </div>
		  </a>
		  <a href="../App.js">
		    <div className="navicon">
			<img src={ reporticon } height="auto" width="40%" alt="Reports" />Reports
		    </div>
		  </a>
		</nav>
	);
}

export default SideNav;
